import {HEADER_TITLE, APP_LOADING} from "../actions/actionTypes";

const initialState = {
    title: "",
    loading: false
};
const HeaderReducer = (state = initialState, action) => {
    switch (action.type) {
        case HEADER_TITLE: {
            return {
                ...state,
                title: action.payload.title,
                breadcrumb: action.payload.breadcrumb,
            };
        }
        case APP_LOADING: {
            return {
                ...state,
                loading: action.payload.loading
            };
        }
        default:
            return state;
    }
};

export default HeaderReducer;
